00132         public static SemVersion Parse(string version, bool strict = false)
00133         {
00134             var match = parseEx.Match(version);
00135             if (!match.Success)
00136             {
00137                 return new SemVersion(0);
00138             }
00139 
00140 #if NETSTANDARD
00141             var major = int.Parse(match.Groups["major"].Value);
00142 #else
00143             var major = int.Parse(match.Groups["major"].Value, CultureInfo.InvariantCulture);
00144 #endif
00145 
00146             var minorMatch = match.Groups["minor"];
00147             int minor = 0;
00148             if (minorMatch.Success) 
00149             {
00150 #if NETSTANDARD
00151                 minor = int.Parse(minorMatch.Value);
00152 #else
00153                 minor = int.Parse(minorMatch.Value, CultureInfo.InvariantCulture);
00154 #endif
00155             }
00156             else if (strict)
00157             {
00158                 throw new InvalidOperationException("Invalid version (no minor version given in strict mode)");
00159             }
00160 
00161             var patchMatch = match.Groups["patch"];
00162             int patch = 0;
00163             if (patchMatch.Success)
00164             {
00165 #if NETSTANDARD
00166                 patch = int.Parse(patchMatch.Value);
00167 #else
00168                 patch = int.Parse(patchMatch.Value, CultureInfo.InvariantCulture);
00169 #endif
00170             }
00171             else if (strict) 
00172             {
00173                 throw new InvalidOperationException("Invalid version (no patch version given in strict mode)");
00174             }
00175 
00176             var prerelease = match.Groups["pre"].Value;
00177             var build = match.Groups["build"].Value;
00178 
00179             return new SemVersion(major, minor, patch, prerelease, build);
00180         }
