00373         public int CompareByPrecedence(SemVersion other)
00374         {
00375             if (ReferenceEquals(other, null))
00376                 return 1;
00377 
00378             var r = this.Major.CompareTo(other.Major);
00379             if (r != 0) return r;
00380 
00381             r = this.Minor.CompareTo(other.Minor);
00382             if (r != 0) return r;
00383 
00384             r = this.Patch.CompareTo(other.Patch);
00385             if (r != 0) return r;
00386 
00387             r = CompareComponent(this.Prerelease, other.Prerelease, true);
00388             return r;
00389         }
