00391         static int CompareComponent(string a, string b, bool lower = false)
00392         {
00393             var aEmpty = String.IsNullOrEmpty(a);
00394             var bEmpty = String.IsNullOrEmpty(b);
00395             if (aEmpty && bEmpty)
00396                 return 0;
00397 
00398             if (aEmpty)
00399                 return lower ? 1 : -1;
00400             if (bEmpty)
00401                 return lower ? -1 : 1;
00402 
00403             var aComps = a.Split('.');
00404             var bComps = b.Split('.');
00405 
00406             var minLen = Math.Min(aComps.Length, bComps.Length);
00407             for (int i = 0; i < minLen; i++)
00408             {
00409                 var ac = aComps[i];
00410                 var bc = bComps[i];
00411                 int anum, bnum;
00412                 var isanum = Int32.TryParse(ac, out anum);
00413                 var isbnum = Int32.TryParse(bc, out bnum);
00414                 int r;
00415                 if (isanum && isbnum)
00416                 {
00417                     r = anum.CompareTo(bnum);
00418                     if (r != 0) return anum.CompareTo(bnum);
00419                 }
00420                 else
00421                 {
00422                     if (isanum)
00423                         return -1;
00424                     if (isbnum)
00425                         return 1;
00426                     r = String.CompareOrdinal(ac, bc);
00427                     if (r != 0)
00428                         return r;
00429                 }
00430             }
00431 
00432             return aComps.Length.CompareTo(bComps.Length);
00433         }
